import React, { useState } from "react";
import {Container} from 'react-bootstrap'

let Header = ({searsh}) => {
    let [value, setvalue] = useState()

    let inputvalue = () => {
        setvalue
    }

    return (
            <div className="header">
            <Container>
                <div className="flex">
                <div className="logo">food</div>
                    <div className="form">
                        <input onChange={setvalue(e.target.value)} value={inputvalue} type="text"/>
                        <button onClick={() => searsh("فطار")}>search food</button>
                    </div>
                </div>
            </Container>
            </div>
    )
}

export default Header
